@translativaju Senta aqui, Ju pteriana. Minha mãe se suicidou próxima ao dia das mães. Hoje eu só tenho meu pai vivo. Senta aqui e me responde, olho no olho. 
EU NÃO POSSO COMEMORAR A DATA COM O ÚNICO FAMILIAR VIVO QUE EU TENHO PORQUE SOU “PRIVILEGIADO”? SÉRIO ISSO? 
Aguardo resposta!

@Politica_LR De este pata, su sonrisa me trae MALA ESPINA.  Me recuerda al SUICIDA cuando volvió a postular x 2da vez CONCHUDAMENTE, y ya sabemos como terminó
"LA JUSTICIA TOCO SU PUERTA, Y... HASTA NUNCA"
La situación del País no está para SONREIR!!!

